import { useState, useEffect } from 'react';
import axios from 'axios'
import { useParams } from "react-router";
import Search_box from './search_box.js';
import Menubar from '../elements/menubar';
import Search_title from './search_titlle.js'
import Search_conts from './search_conts.js';
import Paging from '../elements/page.js';

function Tabel({p_list}) {
    return (
        <table class="table align-middle">
                <thead><tr><th id="t1">구분</th><th>내용</th></tr></thead>
                <tbody>
                    {p_list.map((pl) => {
                        return(
                            <tr class="tr">
                                <td class="align-middle"><p class="widthTh fontFt">{pl[0]}</p></td>
                                <td class="align-middle fontFt">
                                    {pl[1].map((p) => {
                                        return (
                                            <p>{p}</p>
                                        )
                                    })}
                                </td>
                            </tr>
                        )}
                    )}
                </tbody>
        </table>
    )
}

function Test() {
  let [searchData, setSearchData] = useState({});
  const {num} = useParams();
  useEffect(() => {
    async function fetchData() {
      const result = await axios.get(
        "/precedent/detail/" + num
      );
       console.log(result.data);
       setSearchData(result.data);
    }
    fetchData();
  }, [])
  return (
    <div>
    <header id="header">
      <p id="logo">민법을 적용하는 법</p>
      <Menubar/>
      </header>
    <nav id="nav">&nbsp;</nav>
    <div id="section">
        {typeof searchData.p_dic === 'undefined' ? (
            <p>loading...</p>
        ) : (
            <Tabel p_list={searchData.preceList[0]}/>
        )}
    </div>
    <aside id="aside">&nbsp;</aside>
    <footer></footer>
  </div>
    );

};

export default Test;
